func gbPropForRune(r rune) gbProp {
	if r < 256 {
		return gbAsciiLookupTbl[r]
	}

	i, j := 0, len(gbRanges)
	for i < j {
		mid := i + (j-i)/2
		rng := gbRanges[mid]
		if rng.Start <= r && r <= rng.End {
			return rng.Prop
		} else if r < rng.Start {
			j = mid
		} else {
			i = mid + 1
		}
	}
	return gbPropNone
}
